import { Form, Tabs } from "antd";
import { dummy } from "../../utils/dummy";
import { LockOutlined } from "@ant-design/iconsant";

const { TabPane } = Tabs;

const Settings = () => {
  return (
    <div className="settings">
      <Tabs defaultActiveKey="1">
        <TabPane
          tab={
            <span>
              <LockOutlined />
              Password
            </span>
          }
          key="1"
        >
          <Form>
            <Form.Item
              label="Username:"
              name="username"
              labelCol={{ span: 24 }}
            >
              <input type="text" class="form-input" value={dummy.name} />
            </Form.Item>
            <Form.Item
              label="Change your password:"
              name="password"
              labelCol={{ span: 24 }}
            >
              <input type="password" className="form-input" value={""} />
            </Form.Item>
          </Form>
        </TabPane>
      </Tabs>
    </div>
  );
};

export default Settings;
